import React from 'react';

function Profile({ user }) {
    const mode = user.isChild ? "Child Mode" : "Parent Mode";

    return (
        <div className="container page-glass-transition text-center">
            <h2>Profile</h2>
            <p>Name: {user.name}</p>
            <p>Email: {user.email}</p>
            <p>Mode: {mode}</p>
        </div>
    );
}

export default Profile;
